full_text:
Che Italia vuole il @pdnetwork per il 2027?

Una Italia più sostenibile, favorendo la transizione ecologica con:
- trasporto pubblico gratuito per giovani e anziani;
- 100k colonnine elettriche entro il 2027;
- riforma fiscale verde;
- +85 GW di rinnovabili entro il 2030;
1/4

